(57, 'default', 'Updated', 17, 'App\\Page', 1, 'App\\Admin', '{\"ip\":\"::1\",\"module\":\"Page  Management\",\"msg\":\"Update page detail of About Us\",\"old\":{\"id\":17,\"name\":\"About Us\",\"title\":\"Speedo | About Us\",\"contents\":\"<div class=\\\"fullcontainer\\\">\\r\\n<div class=\\\"container\\\">\\r\\n<div class=\\\"inner-container md pb20\\\">\\r\\n<div class=\\\"row\\\">\\r\\n<div class=\\\"col-sm-12 col-md-4\\\">\\r\\n<div class=\\\"row-inner\\\">\\r\\n<div class=\\\"image-gallery\\\">\\r\\n<div id=\\\"about_big\\\"><img class=\\\"responsive bdr\\\" src=\\\"\\/images\\/office-2.jpg\\\" alt=\\\"\\\" \\/><\\/div>\\r\\n<ul class=\\\"pro-thumb\\\">\\r\\n<li><a href=\\\"\\/images\\/ISO-cert-2017-2018.jpg\\\" rel=\\\"enlargeimage::mousedown\\\" rev=\\\"about_big\\\"><img class=\\\"responsive bdr\\\" src=\\\"\\/speedo\\/public\\/images\\/ISO-cert-2017-2018.jpg\\\" alt=\\\"\\\" \\/><\\/a><\\/li>\\r\\n<li><a href=\\\"\\/images\\/BizSAFE-Level-4-2015-2018.jpg\\\" rel=\\\"enlargeimage::mousedown\\\" rev=\\\"about_big\\\"><img class=\\\"responsive bdr\\\" src=\\\"\\/images\\/BizSAFE-Level-4-2015-2018.jpg\\\" alt=\\\"\\\" \\/><\\/a><\\/li>\\r\\n<li><a href=\\\"\\/images\\/office-2.jpg\\\" rel=\\\"enlargeimage::mousedown\\\" rev=\\\"about_big\\\"><img class=\\\"responsive bdr\\\" src=\\\"\\/images\\/office-2.jpg\\\" alt=\\\"\\\" \\/><\\/a><\\/li>\\r\\n<\\/ul>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-sm-12 col-md-8\\\">\\r\\n<div class=\\\"row-inner\\\">\\r\\n<div class=\\\"title3\\\">About Us<\\/div>\\r\\n<p class=\\\"lead\\\">Speedo Marine is a major supplier of an extensive range of industrial equipment and products. Established in 1972, we have since been providing quality products and top-notch service to our valuable customers, majority of whom come from the marine, oil and gas, petrochemical, aerospace, construction, automobile, as well as furniture industries. In the early 2000&rsquo;s, Speedo Marine worked hand in hand with its sister company in Shanghai to venture into the LNG industries in China, providing offshore supply of insulation materials. In recent years, we have also acquired our own hose manufacturing line, producing hoses for the marine industry. As a result of cumulative experience, Speedo Marine today enjoys a reputation of being the leading supplier committed to providing these industries with the best services and products in the field.<\\/p>\\r\\n<p class=\\\"lead\\\">Embracing our values of reliability, integrity, and efficiency, we aim to meet our customers&rsquo; satisfaction through on-time deliveries, fast response, and quality service. To provide greater convenience to our customers, our products are available through our wide network of companies located in Australia (various cities), Malaysia (Johor Bahru), Indonesia (Surabaya) and China (Shanghai, for insulation material).<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\",\"meta_title\":null,\"meta_keyword\":null,\"meta_description\":null,\"menu_id\":\"8\",\"slug\":\"about-us\",\"after_login\":\"0\",\"is_dynamic\":0,\"is_index\":0,\"status\":\"1\",\"delete_status\":0,\"created_at\":\"2018-05-07 14:24:54\",\"updated_at\":\"2018-05-07 14:24:54\"},\"new\":{\"id\":17,\"name\":\"About Us\",\"title\":\"Speedo | About Us\",\"contents\":\"<div class=\\\"fullcontainer\\\">\\r\\n<div class=\\\"container\\\">\\r\\n<div class=\\\"inner-container md pb20\\\">\\r\\n<div class=\\\"row\\\">\\r\\n<div class=\\\"col-sm-12 col-md-4\\\">\\r\\n<div class=\\\"row-inner\\\">\\r\\n<div class=\\\"image-gallery\\\">\\r\\n<div id=\\\"about_big\\\"><img class=\\\"responsive bdr\\\" src=\\\"\\/images\\/office-2.jpg\\\" alt=\\\"\\\" \\/><\\/div>\\r\\n<ul class=\\\"pro-thumb\\\">\\r\\n<li><a href=\\\"\\/images\\/ISO-cert-2017-2018.jpg\\\" rel=\\\"enlargeimage::mousedown\\\" rev=\\\"about_big\\\"><img class=\\\"responsive bdr\\\" src=\\\"\\/speedo\\/public\\/images\\/ISO-cert-2017-2018.jpg\\\" alt=\\\"\\\" \\/><\\/a><\\/li>\\r\\n<li><a href=\\\"\\/images\\/BizSAFE-Level-4-2015-2018.jpg\\\" rel=\\\"enlargeimage::mousedown\\\" rev=\\\"about_big\\\"><img class=\\\"responsive bdr\\\" src=\\\"\\/images\\/BizSAFE-Level-4-2015-2018.jpg\\\" alt=\\\"\\\" \\/><\\/a><\\/li>\\r\\n<li><a href=\\\"\\/images\\/office-2.jpg\\\" rel=\\\"enlargeimage::mousedown\\\" rev=\\\"about_big\\\"><img class=\\\"responsive bdr\\\" src=\\\"\\/images\\/office-2.jpg\\\" alt=\\\"\\\" \\/><\\/a><\\/li>\\r\\n<\\/ul>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-sm-12 col-md-8\\\">\\r\\n<div class=\\\"row-inner\\\">\\r\\n<div class=\\\"title3\\\">About Us<\\/div>\\r\\n<p class=\\\"lead\\\">Speedo Marine is a major supplier of an extensive range of industrial equipment and products. Established in 1972, we have since been providing quality products and top-notch service to our valuable customers, majority of whom come from the marine, oil and gas, petrochemical, aerospace, construction, automobile, as well as furniture industries. In the early 2000&rsquo;s, Speedo Marine worked hand in hand with its sister company in Shanghai to venture into the LNG industries in China, providing offshore supply of insulation materials. In recent years, we have also acquired our own hose manufacturing line, producing hoses for the marine industry. As a result of cumulative experience, Speedo Marine today enjoys a reputation of being the leading supplier committed to providing these industries with the best services and products in the field.<\\/p>\\r\\n<p class=\\\"lead\\\">Embracing our values of reliability, integrity, and efficiency, we aim to meet our customers&rsquo; satisfaction through on-time deliveries, fast response, and quality service. To provide greater convenience to our customers, our products are available through our wide network of companies located in Australia (various cities), Malaysia (Johor Bahru), Indonesia (Surabaya) and China (Shanghai, for insulation material).<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\",\"meta_title\":null,\"meta_keyword\":null,\"meta_description\":null,\"menu_id\":8,\"slug\":\"about-us\",\"after_login\":0,\"is_dynamic\":0,\"is_index\":0,\"status\":1,\"delete_status\":0,\"created_at\":\"2018-05-07 14:24:54\",\"updated_at\":\"2018-05-07 14:24:54\"}}', 0, '2018-05-07 08:54:55', '2018-05-07 08:54:55'),
