(28, 'Life-insurance', 'Dollar Dollar | Life Insurance', NULL, '<div class=\"container\">\r\n<div class=\"ps-block--image\">\r\n<div class=\"ps-block__content\">\r\n<h3 class=\"ps-heading\">Health Insurgence</h3>\r\n<p>Life Insurance Protects Your Loved Ones In An Unfortunate Event Life is unpredictable. Get competitive quotes from the top Life Insurance zproviders through us.</p>\r\n</div>\r\n<img src=\"/dollar_dollar/public/uploads/images/block/life.png\" alt=\"\" /></div>\r\n<div class=\"ps-block--highlight text-center mb-35\">\r\n<h4>Protect Yourself With the Right Life Insurance Policy Now!</h4>\r\n<a class=\"ps-btn\" href=\"/dollar_dollar/public/life-insurance-enquiry\">Get quotes</a></div>\r\n<div class=\"ps-testimonial\">\r\n<div class=\"ps-testimonial__thumbnail\"><img src=\"/dollar_dollar/public/uploads/images/people/1.png\" alt=\"\" /></div>\r\n<div class=\"ps-testimonial__content\">\r\n<p>\"The no-nonsense, expert, unbiased advice from the Financial Advisors helped me determine the right insurance I needed.\"</p>\r\n<img src=\"/dollar_dollar/public/uploads/images/icons/quote.png\" alt=\"\" />\r\n<div class=\"ps-testimonial__detail\">\r\n<h4>Sample name here</h4>\r\nSenior Consultant</div>\r\n</div>\r\n</div>\r\n<div class=\"ps-insurgence\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6 col-md-6 col-sm-12 col-xs-12 \"><img class=\"mb-30\" src=\"/dollar_dollar/public/uploads/images/pages/life.jpg\" alt=\"\" /></div>\r\n<div class=\"col-lg-6 col-md-6 col-sm-12 col-xs-12 \">\r\n<h4>Tomorrow Isn&rsquo;t Guaranteed &ndash; Everything Can Change In an Instant</h4>\r\n<p>Life insurance can&rsquo;t prevent unfortunate accidents. But it can make life easier for the loved ones you&rsquo;ve left behind.</p>\r\n<p>for the loved ones you&rsquo;ve left behind. Nobody likes to think about the possibility of leaving their family behind. But the reality is that if you&rsquo;re not protected, your family can be left struggling financially. It doesn&rsquo;t matter how young or old you are &ndash; the fact is that people of all ages pass on everyday unexpectedly.</p>\r\n<p>Without life insurance, your loved ones could find their grief doubled, emotionally and financially &ndash; and at the worst time possible.</p>\r\n</div>\r\n</div>\r\n<p><strong>Life Insurance Has You and Your Family Covered</strong></p>\r\n<p>Life insurance provides a lump sum payout to the loved ones you nominate in the event of your death. That way, your family won&rsquo;t have to struggle with paying off the home loan, bills, and other daily expenses.</p>\r\n<p><strong>Finding the Right Life Insurance Policy Is Easy</strong></p>\r\n<p>Our experts can help you find the right level of coverage needed to protect you and your family &ndash; at a price that&rsquo;s right.</p>\r\n<table class=\"ps-table ps-table--default ps-table--life\">\r\n<thead>\r\n<tr>\r\n<th>LIFE INSURANCE TYPE</th>\r\n<th>ADVANTAGES</th>\r\n<th>PURPOSE</th>\r\n<th>GUARANTEED DEATH BENEFITS</th>\r\n<th>CASH VALUE</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>Term Life</td>\r\n<td>Simple, affordable coverage for a period of time</td>\r\n<td>Appropriate for short-term coverage needs</td>\r\n<td><span class=\"ps-mark\">Provided premiums are paid as required</span></td>\r\n<td>Available only for return of premium term</td>\r\n</tr>\r\n<tr>\r\n<td>Whole Life</td>\r\n<td>Lifetime coverage with access to cash value</td>\r\n<td>Appropriate for life-long needs</td>\r\n<td><span class=\"ps-mark\">Guaranteed for the life of the policy provided premiums are paid as required</span></td>\r\n<td><span class=\"ps-mark\">Cash value growth is tax-deferred</span></td>\r\n</tr>\r\n<tr>\r\n<td>Universal Life</td>\r\n<td>Flexible coverage and premiums</td>\r\n<td>Appropriate for permanent protection and flexibility</td>\r\n<td><span class=\"ps-mark\">Provided premiums are paid as required</span></td>\r\n<td><span class=\"ps-mark\">Cash value growth is tax-deferred</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', NULL, NULL, 'contact_us_section', NULL, NULL, NULL, 23, 0, 'life-insurance', 0, 0, 0, 0, 1, 0, '2018-05-10 06:02:35', '2018-05-10 06:02:35'),
(29, 'Health insurance', 'Health insurgence', NULL, '<div class=\"container\">\r\n<div class=\"ps-block--image\">\r\n<div class=\"ps-block__content\">\r\n<h3 class=\"ps-heading\">Health Insurance</h3>\r\n<p>Take Care Of Your Medical Needs With The Right Health Insurance Health cost is rising. Get competitive quotes from the top Health Insurance providers through us.</p>\r\n</div>\r\n<img src=\"/dollar_dollar/public/uploads/images/block/health.png\" alt=\"\" /></div>\r\n<div class=\"ps-block--highlight text-center mb-35\">\r\n<h4>Protect Yourself With the Right Health Insurance Policy Now!</h4>\r\n<a class=\"ps-btn\" href=\"/dollar_dollar/public/health-insurance-enquiry\">Get quotes</a></div>\r\n<div class=\"ps-testimonial\">\r\n<div class=\"ps-testimonial__thumbnail\"><img src=\"/dollar_dollar/public/uploads/images/people/1.png\" alt=\"\" /></div>\r\n<div class=\"ps-testimonial__content\">\r\n<p>\"The no-nonsense, expert, unbiased advice from the Financial Advisors helped me determine the right insurance I needed.\"</p>\r\n<img src=\"/dollar_dollar/public/uploads/images/icons/quote.png\" alt=\"\" />\r\n<div class=\"ps-testimonial__detail\">\r\n<h4>Sample name here</h4>\r\nSenior Consultant</div>\r\n</div>\r\n</div>\r\n<div class=\"ps-insurgence\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6 col-md-6 col-sm-12 col-xs-12 \"><img class=\"mb-30\" src=\"/dollar_dollar/public/uploads/images/pages/health.jpg\" alt=\"\" /></div>\r\n<div class=\"col-lg-6 col-md-6 col-sm-12 col-xs-12 \">\r\n<h4>Tomorrow Isn&rsquo;t Guaranteed &ndash; Everything Can Change In an Instant</h4>\r\n<p>Health insurance can&rsquo;t prevent unforeseen health issues, but it can ease your financial burden in the event that you need medical treatment.</p>\r\n<p>Nobody likes to think about the possibility of having to deal with a major illness. But the reality is that if you&rsquo;re not protected, you and your family can be left struggling with hefty medical bills.</p>\r\n<p><strong>Life Insurance Has You and Your Family Covered</strong></p>\r\n<p>Health insurance can help you partially or fully recover the costs you incur as a result of an accident, illness, or disability. That way, you and your family won&rsquo;t be burdened with expensive medical bills.</p>\r\n</div>\r\n</div>\r\n<p><strong>Finding the Right Health Insurance Policy Is Easy</strong></p>\r\n<p>Our experts can help you find the right level of medical coverage needed to protect you in the event of an accident, illness or disability.</p>\r\n<table class=\"ps-table ps-table--default\">\r\n<thead>\r\n<tr>\r\n<th>IF YOU WANT TO...</th>\r\n<th>YOU SHOULD CONSIDER...</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>Have your medical expenses paid</td>\r\n<td><strong>Medical Expense Insurance</strong></td>\r\n</tr>\r\n<tr>\r\n<td>Receive a fixed amount of cash when you are hospitalized</td>\r\n<td><strong>Hospital cash insurance</strong></td>\r\n</tr>\r\n<tr>\r\n<td>Reduce your financial burden when you are diagnosed with a major illness such as cancer</td>\r\n<td><strong>Critical illness insurance</strong></td>\r\n</tr>\r\n<tr>\r\n<td>Replace your income when you are unable to work</td>\r\n<td><strong>Disability income insurance</strong></td>\r\n</tr>\r\n<tr>\r\n<td>Pay the cost of care needed when you are too weak to look after yourself</td>\r\n<td><strong>Long-term care insurance</strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', NULL, NULL, 'contact_us_section', NULL, NULL, NULL, 24, 0, 'health-insurance', 0, 0, 0, 0, 1, 0, '2018-05-16 05:54:52', '2018-05-16 05:54:52'),
(30, 'Health-insurance-enquiry', 'Dollar Dollar | Health Insurance Enquiry', NULL, '<div class=\"ps-block--image\">\r\n<div class=\"ps-block__content\">\r\n<h3 class=\"ps-heading\">Health Insurance</h3>\r\n<p>Take Care Of Your Medical Needs With The Right Health Insurance Health cost is rising. Get competitive quotes from the top Health Insurance providers through us.</p>\r\n</div>\r\n<img src=\"/dollar_dollar/public/uploads/images/block/health.png\" alt=\"\" /></div>\r\n<div class=\"ps-block--highlight text-center mb-35\">\r\n<h4>Welcome to Dollar Dollar\'s Health Insurance Enquiry!</h4>\r\n<p>Answer a few simple questions so one of Dollar Dollar&rsquo;s partners can get you competitive Health Insurance quotes and advise your further.</p>\r\n</div>', NULL, NULL, 'contact_us_section', NULL, NULL, NULL, NULL, 0, 'health-insurance-enquiry', 0, 1, 0, 0, 1, 0, '2018-05-16 05:52:19', '2018-05-16 05:52:19'),
(31, 'Life Insurance Enquiry', 'Dollar Dollar| Life Insurance Enquiry', NULL, '<div class=\"ps-block--image\">\r\n<div class=\"ps-block__content\">\r\n<h3 class=\"ps-heading\">Health Insurgence</h3>\r\n<p>Life Insurance Protects Your Loved Ones In An Unfortunate Event Life is unpredictable. Get competitive quotes from the top Life Insurance zproviders through us.</p>\r\n</div>\r\n<img src=\"/dollar_dollar/public/admin/page/31/dollar_dolar/public/images/block/life.png\" alt=\"\" /></div>\r\n<div class=\"ps-block--highlight text-center mb-35\">\r\n<h4>Welcome to Dollar Dollar\'s Health Insurance Enquiry!</h4>\r\n<p>Answer a few simple questions so ​one of Dollar Dollar&rsquo;s partners can get you competitive Health Insurance quotes and advise your further.</p>\r\n</div>', NULL, NULL, 'contact_us_section', NULL, NULL, NULL, NULL, 28, 'life-insurance-enquiry', 0, 1, 0, 0, 1, 0, '2018-05-17 08:03:49', '2018-05-17 08:03:49'),
